import MyNavBar from "./Nav";
import heroImage from "../assets/MERN.png"

function HeroSection(){
    return(
        <div className="hero">
            <img src={heroImage} alt='hero'/>
        </div>
    )
}
function Home(){
    return(
        <div>
            <MyNavBar/>
            <HeroSection/>
        </div>
    )
}

export default Home;
